INSERT INTO `instruction_box` (`id`, `version`, `code`, `detail`, `meeting_id`, `title`) VALUES
	(1, 0, '0', '1. ขอบัตรประชาชน ถ้าไม่มีบัตรที่ราชการออกให้\n2. กรณีที่มีใบลงทะเบียนบาร์โค้ดมา ให้ผู้ถือหุ้น เซ็นต์ด้านหน้าด้วย', 1, 'มาด้วยตนเอง: ใส่ข้อมูลผู้ถือหุ้น'),
	(2, 0, '1', '1. ตรวจสอบชื่อ นามสกุล ให้ตรงกับใบลงทะเบียนบาร์โค้ด หรือบัตรประชาชน\n2. ตรวจสอบจำนวนหุ้น ให้ตรงกับใบลงทะเบียนบาร์โค้ด\n3. กรณีที่ไม่ตรงกรุณาเรียกผู้ช่วย หรือหัวหน้าทันที ไม่ต้องแจ้งอะไรกับผู้ถือหุ้น', 1, 'มาด้วยตนเอง: ตรวจสอบข้อมูล'),
	(3, 0, '2', '1. ถ้ามีใบลงทะเบียนบาร์โค้ด ให้จดลำดับการลงทะเบียนไว้มุมขวา และเย็บบัตรเข้าร่วมประชุมเข้ากับเอกสาร\n2. ถ้าไม่มีใบลงทะเบียน ให้นำบัตรยืนยันเข้าร่วมประชุม ใส่ซองขาว', 1, 'มาด้วยตนเอง: เรียบร้อย/พิมพ์บัตร'),
	(4, 0, '3', '1. ตรวจหนังสือมอบฉันทะ ต้องเซ็นต์ครบ\n2. ดูสำเนาบัตรประชาชนของผู้มอบฉันทะ พร้อมลายเซ็น', 1, 'รับมอบฉันทะ: ใส่ข้อมูลผู้มอบฉันทะ'),
	(5, 0, '4', '1. ดูสำเนาของผู้รับมอบฉันทะ\n2. ถ้ามอบฉันทะให้กรรมการอิสระ จะไม่มีสำเนาบัตรประชาชน', 1, 'รับมอบฉันทะ: ตรวจสอบข้อมูลผู้ถือหุ้นและใส่ข้อมูลผู้รับมอบฉันทะ'),
	(6, 0, '5', '1. ดูใบแรกสุดของแบบฟอร์มมอบฉันทะ จะมีระบุว่าเป็นประเภทอะไรถ้าไม่มีให้เลือก อื่น ๆ', 1, 'รับมอบฉันทะ: ประเภทการรับมอบฉันทะ'),
	(7, 0, '6', '1. เปิดดูเอกสารให้ครบถ้วน ว่าในแต่ละวาระมีการลงคะแนนหรือไม่\n2. การลงคะแนนสำคัญมาก ห้ามผิดเด็ดขาด', 1, 'รับมอบฉันทะ: การลงคะแนน'),
	(8, 0, '7', '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ', 1, 'รับมอบฉันทะ: เรียบร้อย/พิมพ์บัตร'),
	(9, 0, '8', '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ\n3. เฉพาะ บัตรคูปองต่าง ๆ ส่งให้กับผู้รับมอบฉันทะ\n** ไม่ส่งบัตรลงคะแนนให้เด็ดขาด', 1, 'รับมอบฉันทะ: เรียบร้อย/พิมพ์บัตร'),
	(10, 0, '9', '', 1, 'รับมอบฉันทะ: ลงคะแนนล่วงหน้า'),
	(11, 0, '10', '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ\n3. วาระไหนมีบาร์โค้ด ต้องฉีกให้กับผู้รับมอบฉันทะ', 1, 'รับมอบฉันทะ: เรียบร้อย/พิมพ์บัตร'),
	(12, 0, '11', '1. ตรวจหนังสือมอบฉันทะ ต้องเซ็นต์ครบ\n2. ดูสำเนาบัตรประชาชนของผู้มอบฉันทะ พร้อมลายเซ็น', 1, 'Custodian: ใส่ข้อมูลผู้มอบฉันทะ'),
	(13, 0, '12', '1. ดูสำเนาของผู้รับมอบฉันทะ\n2. ถ้ามอบฉันทะให้กรรมการอิสระ จะไม่มีสำเนาบัตรประชาชน', 1, 'Custodian: ตรวจสอบข้อมูลผู้ถือหุ้นและใส่ข้อมูลผู้รับมอบฉันทะ'),
	(14, 0, '13', '1. ดูใบแรกสุดของแบบฟอร์มมอบฉันทะจะมีระบุว่าเป็นประเภทอะไร ถ้าไม่มีให้เลือกอื่น ๆ', 1, 'Custodian: ต้องการลดหุ้นหรือไม่'),
	(15, 0, '14', '1. เปิดดูเอกสารให้ครบถ้วน ว่าในแต่ละวาระมีการลงคะแนนหรือไม่\n2. การลงคะแนนสำคัญมาก ห้ามผิดเด็ดขาด', 1, 'Custodian: การลงคะแนน'),
	(16, 0, '15', '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ', 1, 'Custodian: เรียบร้อย/พิมพ์บัตร'),
	(17, 0, '16', '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ\n3. เฉพาะ บัตรคูปองต่าง ๆ ส่งให้กับผู้รับมอบฉันทะ\n** ไม่ส่งบัตรลงคะแนนให้เด็ดขาด', 1, 'Custodian: เรียบร้อย/พิมพ์บัตร'),
	(18, 0, '17', '', 1, 'Custodian: ลงคะแนนล่วงหน้า'),
	(19, 0, '18', '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ\n3. วาระไหนมีบาร์โค้ด ต้องฉีกให้กับผู้รับมอบฉันทะ', 1, 'Custodian: เรียบร้อย/พิมพ์บัตร');
INSERT INTO `instruction_box_master` (`id`, `version`, `code`, `company_id`, `detail`, `title`) VALUES
	(1, 0, '0', 1, '1. ขอบัตรประชาชน ถ้าไม่มีบัตรที่ราชการออกให้\n2. กรณีที่มีใบลงทะเบียนบาร์โค้ดมา ให้ผู้ถือหุ้น เซ็นต์ด้านหน้าด้วย', 'มาด้วยตนเอง: ใส่ข้อมูลผู้ถือหุ้น'),
	(2, 0, '1', 1, '1. ตรวจสอบชื่อ นามสกุล ให้ตรงกับใบลงทะเบียนบาร์โค้ด หรือบัตรประชาชน\n2. ตรวจสอบจำนวนหุ้น ให้ตรงกับใบลงทะเบียนบาร์โค้ด\n3. กรณีที่ไม่ตรงกรุณาเรียกผู้ช่วย หรือหัวหน้าทันที ไม่ต้องแจ้งอะไรกับผู้ถือหุ้น', 'มาด้วยตนเอง: ตรวจสอบข้อมูล'),
	(3, 0, '2', 1, '1. ถ้ามีใบลงทะเบียนบาร์โค้ด ให้จดลำดับการลงทะเบียนไว้มุมขวา และเย็บบัตรเข้าร่วมประชุมเข้ากับเอกสาร\n2. ถ้าไม่มีใบลงทะเบียน ให้นำบัตรยืนยันเข้าร่วมประชุม ใส่ซองขาว', 'มาด้วยตนเอง: เรียบร้อย/พิมพ์บัตร'),
	(4, 0, '3', 1, '1. ตรวจหนังสือมอบฉันทะ ต้องเซ็นต์ครบ\n2. ดูสำเนาบัตรประชาชนของผู้มอบฉันทะ พร้อมลายเซ็น', 'รับมอบฉันทะ: ใส่ข้อมูลผู้มอบฉันทะ'),
	(5, 0, '4', 1, '1. ดูสำเนาของผู้รับมอบฉันทะ\n2. ถ้ามอบฉันทะให้กรรมการอิสระ จะไม่มีสำเนาบัตรประชาชน', 'รับมอบฉันทะ: ตรวจสอบข้อมูลผู้ถือหุ้นและใส่ข้อมูลผู้รับมอบฉันทะ'),
	(6, 0, '5', 1, '1. ดูใบแรกสุดของแบบฟอร์มมอบฉันทะ จะมีระบุว่าเป็นประเภทอะไรถ้าไม่มีให้เลือก อื่น ๆ', 'รับมอบฉันทะ: ประเภทการรับมอบฉันทะ'),
	(7, 0, '6', 1, '1. เปิดดูเอกสารให้ครบถ้วน ว่าในแต่ละวาระมีการลงคะแนนหรือไม่\n2. การลงคะแนนสำคัญมาก ห้ามผิดเด็ดขาด', 'รับมอบฉันทะ: การลงคะแนน'),
	(8, 0, '7', 1, '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ', 'รับมอบฉันทะ: เรียบร้อย/พิมพ์บัตร'),
	(9, 0, '8', 1, '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ\n3. เฉพาะ บัตรคูปองต่าง ๆ ส่งให้กับผู้รับมอบฉันทะ\n** ไม่ส่งบัตรลงคะแนนให้เด็ดขาด', 'รับมอบฉันทะ: เรียบร้อย/พิมพ์บัตร'),
	(10, 0, '9', 1, '', 'รับมอบฉันทะ: ลงคะแนนล่วงหน้า'),
	(11, 0, '10', 1, '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ\n3. วาระไหนมีบาร์โค้ด ต้องฉีกให้กับผู้รับมอบฉันทะ', 'รับมอบฉันทะ: เรียบร้อย/พิมพ์บัตร'),
	(12, 0, '11', 1, '1. ตรวจหนังสือมอบฉันทะ ต้องเซ็นต์ครบ\n2. ดูสำเนาบัตรประชาชนของผู้มอบฉันทะ พร้อมลายเซ็น', 'Custodian: ใส่ข้อมูลผู้มอบฉันทะ'),
	(13, 0, '12', 1, '1. ดูสำเนาของผู้รับมอบฉันทะ\n2. ถ้ามอบฉันทะให้กรรมการอิสระ จะไม่มีสำเนาบัตรประชาชน', 'Custodian: ตรวจสอบข้อมูลผู้ถือหุ้นและใส่ข้อมูลผู้รับมอบฉันทะ'),
	(14, 0, '13', 1, '1. ดูใบแรกสุดของแบบฟอร์มมอบฉันทะจะมีระบุว่าเป็นประเภทอะไร ถ้าไม่มีให้เลือกอื่น ๆ', 'Custodian: ต้องการลดหุ้นหรือไม่'),
	(15, 0, '14', 1, '1. เปิดดูเอกสารให้ครบถ้วน ว่าในแต่ละวาระมีการลงคะแนนหรือไม่\n2. การลงคะแนนสำคัญมาก ห้ามผิดเด็ดขาด', 'Custodian: การลงคะแนน'),
	(16, 0, '15', 1, '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ', 'Custodian: เรียบร้อย/พิมพ์บัตร'),
	(17, 0, '16', 1, '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ\n3. เฉพาะ บัตรคูปองต่าง ๆ ส่งให้กับผู้รับมอบฉันทะ\n** ไม่ส่งบัตรลงคะแนนให้เด็ดขาด', 'Custodian: เรียบร้อย/พิมพ์บัตร'),
	(18, 0, '17', 1, '', 'Custodian: ลงคะแนนล่วงหน้า'),
	(19, 0, '18', 1, '1. จดลำดับการลงทะเบียนไว้มุมขวา\n2. เย็บบัตรเข้าร่วมประชุมไว้มุมซ้าย ด้านหน้าของเอกสารรับมอบฉันทะ\n3. วาระไหนมีบาร์โค้ด ต้องฉีกให้กับผู้รับมอบฉันทะ', 'Custodian: เรียบร้อย/พิมพ์บัตร');
